const ShapeProduct = ({ productData }) => {
  return (
    <div>
      <img src={productData.img} />
      <h3>{productData.title}</h3>
      <p>{productData.price}</p>
      <div>
        <a>Details</a>
        <div>
          <button>add to cart</button>
        </div>
      </div>
    </div>
  );
};

export default ShapeProduct;
